\title{antwort auf multiple-choice-frage}
\author{deutsch29}
\date{}

\begin{document}

\maketitle

bei welcher diagnose ist die hochlagerung der beine kontraindiziert (a) hypovolämischer schock (b) anaphylaktischer schock (c) hypoglykämischer schock (d) kardiogener schock (e) septisch-toxischer schock

\section*{antwort}
b

\end{document}

die antwort auf die frage lautet "b", da bei einem anaphylaktischen schock eine hochlagerung der beine kontraindiziert ist
